import React, { useState } from 'react';
import './App.css';

const Player = () => {
  const [points, setPoints] = useState(20);

  return (
    <div>
      <p> You have { points } points </p>
    </div>
  )
}

const Counter = () => {
  const [count, setCount] = useState(0);

  return (
    <div>
      <button onClick={() => setCount(count + 1)}>
        Increase
      </button>
      <p> { count } </p>
      <Player></Player>
    </div>
  )
}

function App() {
  return (
    <div>
      <Counter>

      </Counter>
    </div>
  );
}

export default App
